This is in Spanish and includes Enlgish Subtitles.
This is a 4 star movie that shows some of the most important parts of history in America. The first trek from Florida to Mexico, the first slave on American soil to gain freedom and influence, the first Europeans to demand rights for its Native inhabitants. In my opinion a great movie and Very important history for Everyone on the North American continent.


From the back cover.

ROGER CORMAN PRESENTS A NICOLAS ECHEVARRIA FILM
&quot;The true and amazing adventure of the legendary spanish explorer that will dazzle your mind and move your soul&quot;.

In 1528, a Spanish expedition founders off the coast of Florida. The lone survivor, Alvar Nunez Cabeza de Vaca discovers an ancient Indian tribe. He learns their mystical and mysterious culture, becoming a healer and a leader. But this New World collides with the Old World when Spanish Conquistadors arrive to enslave the Indians. Cabaze de Vaca must confront his own people and his past.

Apprx run time 108 Mins.
